import React,{useEffect} from "react";

import './App.css';
import {fetchUsers} from "./redux/actions/userAction";
import {useSelector} from "react-redux";

function App() {
  const users=useSelector(state=>state.users.users)

  useEffect(()=>{
    fetchUsers()
  },[])
  console.log(users)
  return (
    <div className="App">

    </div>
  );
}

export default App;
